import React from 'react';
import {
  createMuiTheme
} from '@material-ui/core/styles';
import './App.css';
import red from '@material-ui/core/colors/red';

class App extends React.Component{

  readonly theme = createMuiTheme({
    palette: {
      primary: {
        main: red[600]
      },
      background: {
        default: red[100]
      }
    }
  });

  render() {
    return (
      <div style={{
      backgroundColor: this.theme.palette.background.default,
      minHeight: window.innerHeight -.98
      }}>
      <h2>Click here to login!</h2>
      <button onClick={() => console.log("clicked!")}>
        Hello World!
      </button>
      </div>
    );
  }
}

export default App;
